import React from 'react';

const listData = [];
for (let i=0; i < 5; i++) {
  listData.push({
    index: i,
    name: "This is user: " + i,
    score: i * 10,
    game: 'poker'
  });
}

const Player = (props) => {
  return (
    <ul>
      {listData.map(function(index, name, score, game){
        return <li key={ index }>Name: {name}, Score: {score}, Game: {game}</li>;
      })}
    </ul>
  );
}

export default Player;
